CREATE MODULE default::emptysub IF NOT EXISTS;
CREATE MODULE default::sub IF NOT EXISTS;
CREATE MODULE default::sub::subsub IF NOT EXISTS;
CREATE SCALAR TYPE default::Color EXTENDING enum<Red, Orange, Yellow, Green, Blue, Indigo, Violet>;
CREATE SCALAR TYPE default::PositiveInt EXTENDING std::int64 {
    CREATE CONSTRAINT std::min_value(1);
};
CREATE TYPE default::AssortedScalars {
    CREATE PROPERTY nested_mixed: array<tuple<array<std::int64>, std::json>>;
    CREATE PROPERTY bstr: std::bytes;
    CREATE PROPERTY date: std::cal::local_date;
    CREATE PROPERTY json: std::json;
    CREATE PROPERTY lts: std::cal::local_datetime;
    CREATE REQUIRED PROPERTY name: std::str;
    CREATE PROPERTY positive: default::PositiveInt;
    CREATE PROPERTY time: std::cal::local_time;
    CREATE PROPERTY ts: std::datetime;
};
CREATE TYPE default::KitchenSink {
    CREATE REQUIRED PROPERTY p_arrtup: array<tuple<std::str>>;
    CREATE REQUIRED MULTI PROPERTY p_multi_arrtup: array<tuple<std::str>>;
    CREATE PROPERTY p_opt_arrtup: array<tuple<std::str>>;
    CREATE MULTI PROPERTY p_opt_multi_arrtup: array<tuple<std::str>>;
    CREATE REQUIRED PROPERTY array: array<std::str>;
    CREATE REQUIRED MULTI PROPERTY p_multi_arr: array<std::str>;
    CREATE REQUIRED MULTI PROPERTY p_multi_str: std::str;
    CREATE REQUIRED MULTI PROPERTY p_multi_tuparr: tuple<array<std::str>>;
    CREATE PROPERTY p_opt_arr: array<std::str>;
    CREATE MULTI PROPERTY p_opt_multi_arr: array<std::str>;
    CREATE MULTI PROPERTY p_opt_multi_str: std::str;
    CREATE MULTI PROPERTY p_opt_multi_tuparr: tuple<array<std::str>>;
    CREATE PROPERTY p_opt_str: std::str;
    CREATE PROPERTY p_opt_tuparr: tuple<array<std::str>>;
    CREATE REQUIRED PROPERTY p_tuparr: tuple<array<std::str>>;
    CREATE REQUIRED PROPERTY str: std::str;
};
CREATE FUNCTION default::add_numbers(a: std::float64, b: std::float64) ->  std::float64 USING ((a + b));
CREATE FUNCTION default::add_numbers(a: std::int64, b: std::int64) ->  std::int64 USING ((a + b));
CREATE FUNCTION default::add_numbers(a: std::str, b: std::str) ->  std::str USING ((a ++ b));
CREATE FUNCTION default::complex_func(x: std::float64) ->  std::str USING (('float: ' ++ <std::str>x));
CREATE FUNCTION default::complex_func(x: std::int64) ->  std::str USING (('int: ' ++ <std::str>x));
CREATE FUNCTION default::complex_func(x: std::int64, y: std::str) ->  std::str USING (((('int+str: ' ++ <std::str>x) ++ ' ') ++ y));
CREATE FUNCTION default::complex_func(x: std::str) ->  std::str USING (('str: ' ++ x));
CREATE FUNCTION default::complex_func(x: std::str, y: std::int64) ->  std::str USING (((('str+int: ' ++ x) ++ ' ') ++ <std::str>y));
CREATE FUNCTION default::complex_variadic(required_param: std::str, optional_param: std::str = 'default', VARIADIC var_params: std::int64, NAMED ONLY flag: std::bool = false, NAMED ONLY multiplier: std::float64 = 1.0) ->  std::str USING (((((((required_param ++ ' (') ++ optional_param) ++ ')') ++ ' sum=') ++ <std::str><std::int64>(std::sum(std::array_unpack(var_params)) * multiplier)) ++ (' [FLAG]' IF flag ELSE '')));
CREATE FUNCTION default::format_text(text: std::str, NAMED ONLY prefix: std::str = '', NAMED ONLY suffix: std::str = '', NAMED ONLY uppercase: std::bool = false) ->  std::str USING (((prefix ++ (std::str_upper(text) IF uppercase ELSE text)) ++ suffix));
CREATE FUNCTION default::format_text_variadic(s: std::str, VARIADIC a: std::int64, NAMED ONLY suffix: std::str = '-suf', NAMED ONLY prefix: std::str = 'pref-') ->  std::str USING ((((prefix ++ s) ++ <std::str>std::sum(std::array_unpack(a))) ++ suffix));
CREATE FUNCTION default::format_user(name: std::str, prefix: OPTIONAL std::str = 'User') ->  std::str USING ((((prefix ?? 'User') ++ ': ') ++ name));
CREATE FUNCTION default::format_user(name: std::str, prefix: std::str, suffix: std::str) ->  std::str USING (((((prefix ++ ': ') ++ name) ++ ' ') ++ suffix));
CREATE FUNCTION default::format_with_options(text: std::str, NAMED ONLY bold: std::bool = false, NAMED ONLY italic: std::bool = false, NAMED ONLY prefix: std::str = '', NAMED ONLY suffix: std::str = '') ->  std::str USING (((((((prefix ++ ('[BOLD]' IF bold ELSE '')) ++ ('[ITALIC]' IF italic ELSE '')) ++ text) ++ ('[/ITALIC]' IF italic ELSE '')) ++ ('[/BOLD]' IF bold ELSE '')) ++ suffix));
CREATE ABSTRACT TYPE default::Named {
    CREATE REQUIRED PROPERTY name: std::str;
    CREATE PROPERTY name_len := (std::len(.name));
    CREATE PROPERTY nickname: std::str;
    CREATE PROPERTY nickname_len := (std::len(.nickname));
};
CREATE TYPE default::User EXTENDING default::Named;
CREATE FUNCTION default::get_value(input: default::User) ->  std::str USING (input.name);
CREATE FUNCTION default::get_value(input: std::int64) ->  std::int64 USING (input);
CREATE FUNCTION default::get_value(input: std::str) ->  std::str USING (input);
CREATE FUNCTION default::join_strings(texts: array<std::str>, separator: std::str = ' ') ->  std::str USING (std::array_join(texts, separator));
CREATE FUNCTION default::join_variadic(separator: std::str, VARIADIC items: std::str) ->  std::str USING (std::array_join(items, separator));
CREATE FUNCTION default::optional_multiply(x: std::int64, multiplier: OPTIONAL std::float64 = <optional float64>{}) ->  std::float64 USING ((<std::float64>x * (multiplier ?? 1.0)));
CREATE FUNCTION default::optional_sum(VARIADIC addends: std::int64, NAMED ONLY base: std::int64 = 0) ->  std::int64 USING ((base + std::sum(std::array_unpack(addends))));
CREATE FUNCTION default::process_tuple(data: tuple<std::str, std::int64>) ->  std::str USING (((data.0 ++ ' - ') ++ <std::str>data.1));
CREATE FUNCTION default::process_tuple(data: tuple<std::str, std::str>) ->  std::str USING (((data.0 ++ ' | ') ++ data.1));
CREATE FUNCTION default::process_variadic(base: std::str, VARIADIC numbers: std::int64, NAMED ONLY multiplier: std::int64 = 1) ->  std::str USING (((base ++ ': ') ++ <std::str>(std::sum(std::array_unpack(numbers)) * multiplier)));
CREATE FUNCTION default::simple_add(x: std::int64, y: std::int64 = 10) ->  std::int64 USING ((x + y));
CREATE FUNCTION default::simple_concat(text1: std::str, text2: std::str = 'default') ->  std::str USING (((text1 ++ ' ') ++ text2));
CREATE FUNCTION default::sum_array(values: array<std::float64>) ->  std::float64 USING (std::sum(std::array_unpack(values)));
CREATE FUNCTION default::sum_array(values: array<std::int64>) ->  std::int64 USING (std::sum(std::array_unpack(values)));
CREATE FUNCTION default::sum_variadic(VARIADIC values: std::int64) ->  std::int64 USING (std::sum(std::array_unpack(values)));
CREATE FUTURE simple_scoping;
CREATE GLOBAL default::current_game_session_num -> std::int64;
CREATE TYPE default::GameSession {
    CREATE MULTI LINK players: default::User {
        CREATE CONSTRAINT std::exclusive;
        CREATE PROPERTY is_tall_enough: std::bool;
    };
    CREATE REQUIRED PROPERTY num: std::int64 {
        CREATE CONSTRAINT std::exclusive;
    };
    CREATE REQUIRED PROPERTY public: std::bool {
        SET default := false;
    };
    CREATE PROPERTY time_limit: std::int64 {
        SET default := 60;
    };
};
CREATE SINGLE GLOBAL default::CurrentGameSession := (SELECT
    default::GameSession
FILTER
    (.num = GLOBAL default::current_game_session_num)
);
CREATE TYPE default::AllOptional {
    CREATE LINK pointer: default::AllOptional;
    CREATE PROPERTY field: std::str;
};
CREATE TYPE default::BaseLink {
    CREATE REQUIRED PROPERTY val: std::str;
};
CREATE TYPE default::ImpossibleLink0 EXTENDING default::BaseLink {
    CREATE REQUIRED LINK il1: default::BaseLink;
};
CREATE TYPE default::ImpossibleLink1 EXTENDING default::BaseLink {
    CREATE REQUIRED LINK il0: default::ImpossibleLink0;
};
CREATE TYPE default::CustomUser EXTENDING default::User;
CREATE TYPE default::UserGroup EXTENDING default::Named {
    CREATE MULTI LINK users: default::User;
    CREATE PROPERTY mascot: std::str;
};
ALTER TYPE default::User {
    CREATE LINK groups := (.<users[IS default::UserGroup]);
};
CREATE ABSTRACT TYPE default::ExclusivelyNamed {
    CREATE REQUIRED PROPERTY name: std::str {
        CREATE DELEGATED CONSTRAINT std::exclusive;
    };
};
CREATE TYPE default::TestLinkTrigger EXTENDING default::ExclusivelyNamed {
    CREATE LINK user: default::User;
    CREATE TRIGGER set_default_user
        AFTER UPDATE, INSERT 
        FOR EACH DO (UPDATE
            __new__.user
        SET {
            nickname := __new__.name
        });
};
CREATE TYPE default::EnumTest {
    CREATE REQUIRED PROPERTY color: default::Color;
    CREATE REQUIRED PROPERTY name: std::str;
};
CREATE TYPE default::Team EXTENDING default::ExclusivelyNamed {
    CREATE MULTI LINK members: default::User {
        CREATE PROPERTY rank: std::int64;
        CREATE PROPERTY role: std::str;
    };
};
CREATE TYPE default::ExtraTeam EXTENDING default::Team {
    CREATE MULTI PROPERTY member_names := (.members.name);
};
CREATE TYPE default::Loot EXTENDING default::ExclusivelyNamed {
    CREATE LINK owner: default::User;
};
CREATE TYPE default::Party EXTENDING default::ExclusivelyNamed {
    CREATE REQUIRED MULTI LINK members: default::User;
};
CREATE TYPE default::Raid EXTENDING default::ExclusivelyNamed {
    CREATE REQUIRED MULTI LINK members: default::User {
        CREATE PROPERTY rank: std::int64;
        CREATE PROPERTY role: std::str;
    };
};
CREATE TYPE default::StackableLoot EXTENDING default::ExclusivelyNamed {
    CREATE LINK owner: default::User {
        CREATE PROPERTY bonus: std::bool;
        CREATE PROPERTY count: std::int64;
    };
};
CREATE TYPE default::TestLinkDefault EXTENDING default::ExclusivelyNamed {
    CREATE LINK user: default::User {
        SET default := (SELECT
            default::User FILTER
                (.name = 'Alice')
        LIMIT
            1
        );
    };
};
CREATE TYPE default::TestLinkRewrite EXTENDING default::ExclusivelyNamed {
    CREATE LINK user: default::User {
        CREATE REWRITE
            INSERT 
            USING (SELECT
                default::User ORDER BY
                    (.name < __subject__.name) ASC THEN
                    .name ASC
            LIMIT
                1
            );
        CREATE REWRITE
            UPDATE 
            USING (SELECT
                default::User ORDER BY
                    (.name < __subject__.name) ASC THEN
                    .name ASC
            LIMIT
                1
            );
    };
};
CREATE TYPE default::TestPropRewrites EXTENDING default::ExclusivelyNamed {
    CREATE REQUIRED PROPERTY name_len: std::int64 {
        CREATE REWRITE
            INSERT 
            USING (std::len(.name));
        CREATE REWRITE
            UPDATE 
            USING (std::len(.name));
    };
    CREATE PROPERTY toggle: std::bool {
        CREATE REWRITE
            INSERT 
            USING (NOT (.toggle));
        CREATE REWRITE
            UPDATE 
            USING (NOT (.toggle));
    };
};
CREATE TYPE default::Image {
    CREATE REQUIRED LINK author: default::User {
        CREATE PROPERTY caption: std::str;
        CREATE PROPERTY year: std::int64;
    };
    CREATE REQUIRED PROPERTY file: std::str;
};
CREATE TYPE default::LinearPath {
    CREATE LINK next: default::LinearPath {
        CREATE CONSTRAINT std::exclusive;
    };
    CREATE REQUIRED PROPERTY label: std::str {
        CREATE CONSTRAINT std::exclusive;
    };
};
CREATE TYPE default::StepPath {
    CREATE LINK next: default::LinearPath {
        CREATE CONSTRAINT std::exclusive;
        CREATE PROPERTY steps: std::int64 {
            SET default := 1;
        };
    };
    CREATE REQUIRED PROPERTY label: std::str {
        CREATE CONSTRAINT std::exclusive;
    };
};
CREATE TYPE default::MultiRangeTest {
    CREATE PROPERTY date_mrange: multirange<std::cal::local_date>;
    CREATE PROPERTY float_mrange: multirange<std::float64>;
    CREATE PROPERTY int_mrange: multirange<std::int64>;
    CREATE REQUIRED PROPERTY name: std::str;
};
CREATE TYPE default::Post {
    CREATE REQUIRED LINK author: default::User;
    CREATE REQUIRED PROPERTY body: std::str;
};
CREATE TYPE default::sub::subsub::TypeInSubSub;
CREATE TYPE default::sub::TypeInSub {
    CREATE LINK post: default::Post;
    CREATE LINK subsub: default::sub::subsub::TypeInSubSub;
    CREATE PROPERTY ntup: tuple<a: std::str, b: tuple<c: std::int64, d: std::str>>;
};
CREATE TYPE default::RangeTest {
    CREATE PROPERTY date_range: range<std::cal::local_date>;
    CREATE PROPERTY datetime_range: range<std::cal::local_datetime>;
    CREATE PROPERTY float_range: range<std::float64>;
    CREATE PROPERTY int_range: range<std::int64>;
    CREATE REQUIRED PROPERTY name: std::str;
    CREATE PROPERTY tz_datetime_range: range<std::datetime>;
};
CREATE TYPE default::TestSingleLinks {
    CREATE LINK opt_friend: default::User;
    CREATE LINK comp_opt_friend := (.opt_friend);
    CREATE LINK opt_wprop_friend: default::User {
        CREATE PROPERTY strength: std::int32;
    };
    CREATE LINK comp_opt_wprop_friend := (.opt_wprop_friend);
    CREATE REQUIRED LINK req_friend: default::User;
    CREATE LINK comp_req_friend := (.req_friend);
    CREATE REQUIRED LINK req_wprop_friend: default::User {
        CREATE PROPERTY strength: std::int32;
    };
    CREATE LINK comp_req_wprop_friend := (.req_wprop_friend);
};
CREATE TYPE default::`limit` {
    CREATE LINK `commit`: default::User;
    CREATE MULTI LINK `configure`: default::User {
        CREATE PROPERTY `create`: std::bool;
    };
    CREATE PROPERTY `alter`: std::bool;
    CREATE PROPERTY `like`: std::str;
};
